import React, { Component } from 'react';
import {AppBar,MuiThemeProvider ,TextField,RaisedButton} from '@material-ui/core';

class FormUserDetails extends Component {

    continue = e => {
        e.prevenDefault();
        this.props.nextStep();
    }

    render() { 
        const {values,handleChange} = this.props;
        return ( 
            <div>
                <MuiThemeProvider>
                    <React.Fragment>
                        <TextField 
                        hintText = "Enter The First Name"
                        floatingLabelText="firstName"
                        onChange = {handleChange('firstName')}
                        defaultValues = {values.firstName}/>
                        <br/>
                        <TextField 
                        hintText = "Enter The Last Name"
                        floatingLabelText="lastName"
                        onChange = {handleChange('lastName')}
                        defaultValues = {values.firstName}/>
                        <br/>
                        <TextField 
                        hintText = "Enter The Email"
                        floatingLabelText="email"
                        onChange = {handleChange('email')}
                        defaultValues = {values.email}/>
                        <br/>

                        <RaisedButton 
                        label = "Continue"
                        primary = {true}
                        style = {StyleSheet.button}
                        onClick = {this.continue}/>
                    </React.Fragment>
                </MuiThemeProvider>
                {/* <input type="text" values = {values.firstName} onChange ={handleChange('firstName')}/> */}
            </div> 
        );

    }

}

export default FormUserDetails;
